const theme = {
  colors: {
    background: '#121212',     // Midnight Black (background)
    text: '#FFFFFF',           // White (text)
    primary: '#1f1137',        // Electric Blue (primary)
    secondary: '#f39c12',      // Bright Orange (secondary)
    accent: '#27ae60',         // Emerald Green (accent)
    cta: '#e74c3c',            // Tango Red (call to action)
    accent2: '#9b59b6',        // Amethyst Purple (additional accent)
  },
};

export default theme;
